import './App.css'
import Cart from './components/pages/Cart'
import Catalog from './components/pages/Catalog'
import {Link, Routes, Route} from "react-router-dom"

function App() {
  return (
    <div className="App">
      <h1>kjhkjh</h1>
      <Routes>
        <Route exact path="/">
          <Catalog />
        </Route>
        <Route path="/cart">
          <Cart />
        </Route>
      </Routes>
    </div>
  );
}

export default App;
